fun formatDate(date: Date?, format: String = "YYYY-MM-DD"): String {
    var _date = Date()
    if (date != null) {
        _date = date
    }
    val year = _date.getFullYear()
    val month = (_date.getMonth() + 1).toString(10).padStart(2, "0")
    val day = _date.getDate().toString(10).padStart(2, "0")
    val hours = _date.getHours().toString(10).padStart(2, "0")
    val minutes = _date.getMinutes().toString(10).padStart(2, "0")
    val seconds = _date.getSeconds().toString(10).padStart(2, "0")
    when (format) {
        "YYYY-MM-DD" -> 
            return "" + year + "-" + month + "-" + day
        "YYYY-MM-DD HH:mm:ss" -> 
            return "" + year + "-" + month + "-" + day + " " + hours + ":" + minutes + ":" + seconds
        else -> 
            return "" + year + "-" + month + "-" + day
    }
}
fun formatTime(seconds: Number, format: String = "MM:SS"): String {
    val hours = Math.floor(seconds / 3600).toString(10).padStart(2, "0")
    val minutes = Math.floor((seconds % 3600) / 60).toString(10).padStart(2, "0")
    val secs = (seconds % 60).toString(10).padStart(2, "0")
    when (format) {
        "MM:SS" -> 
            return "" + minutes + ":" + secs
        "HH:MM:SS" -> 
            return "" + hours + ":" + minutes + ":" + secs
        else -> 
            return "" + minutes + ":" + secs
    }
}
fun splitText(str: String): UTSArray<wordList> {
    val matches = str.match(UTSRegExp("\\b[\\w\\u2018\\u2019\\u0027]+\\b|[.,!?;]", "g")) ?: _uA()
    var arr = _uA<wordList>()
    if (matches.length > 0) {
        matches.forEach(fun(item, index, _array){
            arr.push(wordList(word = item!!, type = if (UTSRegExp("^[.,!?;]\$", "").test(item!!)) {
                1
            } else {
                0
            }
            , sort = index))
        }
        )
    }
    return arr
}
