            , complete = fun(_){}))
        }
        )
    }
    open fun getfollowArr(): UTSPromise<UTSArray<followAlongItem>> {
        return wrapUTSPromise(suspend w@{
                var _data: UTSArray<followAlongItem>
                if (this.isReview) {
                    if (this.list != null && this.currentElementIndex < this.list!!.length) {
                        return@w this.list!!.slice(this.currentElementIndex)
                    } else {
                        return@w _uA()
                    }
                }
                if (this.taksId != 0) {
                    _data = await(this.getTask80())
                } else {
                    _data = await(this.getSubjectLow80())
                }
                if (_data.length >= 5) {
                    return@w _data.slice(0, 5)
                }
                var _list = _uA<followAlongItem>()
                _list = _data.slice()
                var _thisList = this.list
                if (_thisList != null && _list.length < 5) {
                    val needCount = 5 - _list.length
                    val supplementItems = _thisList.slice(this.currentElementIndex, this.currentElementIndex + needCount)
                    this.currentElementIndex += supplementItems.length
                    _list = _list.concat(supplementItems)
                }
                return@w _list
        })
    }
    open fun followNext(): UTSPromise<followAlongItem?> {
        return wrapUTSPromise(suspend w@{
                var currentGroup = this.followTemp
                if (currentGroup.length == 0) {
                    var _data = await(this.getfollowArr())
                    if (_data.length == 0) {
                        return@w null
                    }
                    this.followTemp = _data
                    currentGroup = _data
                }
                if (this.currentElementIndexFollow >= currentGroup.length) {
                    this.smailNum++
                    if (this.smailNum <= 2) {
                        this.onSmailNumFn(this.smailNum)
                        this.currentElementIndexFollow = 0
                    } else {
                        this.currentElementIndexFollow = 0
                        this.smailNum = 0
                        this.onSmailNumFn(this.smailNum)
                        this.followTemp = _uA()
                        if (this.isReview) {
                            return@w null
                        }
                        return@w this.followNext()
                    }
                }
                return@w currentGroup[this.currentElementIndexFollow++]
        })
    }
    open fun next(): UTSPromise<followAlongItem?> {
        return wrapUTSPromise(suspend w@{
                val _list = this.list
                if (this.isFollow) {
                    return@w this.followNext()
                }
                if (_list != null) {
                    if (this.isReturn80) {
                        if (this.nextCallCount >= 4 && !this.hasReturnedErr80 || this.currentElementIndex >= _list.length) {
                            var _data: UTSArray<followAlongItem>
                            if (this.taksId != 0) {
                                _data = await(this.getTask80())
                            } else {
                                _data = await(this.getSubjectLow80())
                            }
                            if (_data.length != 0) {
                                console.log("返回低于80题目")
                                this.hasReturnedErr80 = true
                                val returnItem = _data[0]
                                this.isErr80 = true
                                this.addTemp(returnItem)
                                console.log("低于80", returnItem)
                                this.nextCallCount = 0
                                if (_data.length == 1) {
                                    this.isLast = true
                                } else {
                                    this.isLast = false
                                }
                                return@w returnItem
                            }
                        }
                    }
                }
                this.isErr80 = false
                val list80 = this.list80
                if (list80 != null) {
                    if (list80.length > 0 && this.list80ElementIndex < list80.length) {
                        this.is80 = true
                        this.addTemp(list80[this.list80ElementIndex])
                        return@w list80[this.list80ElementIndex++]
                    }
                    if (this.is80 && this.list80ElementIndex >= list80.length) {
                        this.is80 = false
                    }
                }
                if (_list == null) {
                    return@w null
                }
                if (_list.length == 0) {
                    return@w null
                }
                if (this.currentElementIndex < _list.length) {
                    this.nextCallCount++
                    this.addTemp(_list[this.currentElementIndex])
                    this.onCompleteFn(this.currentElementIndex)
                    this.isLast = false
                    var returnItem = _list[this.currentElementIndex++]
                    if (this.currentElementIndex == _list.length) {
                        this.isLast = true
                    }
                    return@w returnItem
                }
                if (this.tempList != null) {
                    this.onTempFn(this.tempList)
                    this.tempList = null
                }
                await(sleep(500))
                return@w null
        })
    }
    open fun initialize() {
        this.list = null
        this.list80 = null
        this.err80 = null
        this.tempList = null
        this.followTemp = _uA()
        this.currentElementIndex = 0
        this.list80ElementIndex = 0
        this.currentElementIndexFollow = 0
        this.nextCallCount = 0
        this.nextTempCount = 0
        this.followNextNumCount = 0
        this.smailNum = 0
        this.is80 = false
        this.isErr80 = false
        this.hasReturnedErr80 = false
        this.isFollow = false
        this.isReturn80 = true
        this.isTest = false
        this.isTask = false
        this.isReview = false
        this.module = ""
        this.subModule = ""
        this.taksId = 0
    }
    private fun _getNextItem(): UTSPromise<followAlongItem?> {
        return wrapUTSPromise(suspend w@{
                val _list = this.list
                var _data = await(this.getSubjectLow80())
                if (_data.length != 0) {
                    this.hasReturnedErr80 = true
                    this.isErr80 = true
                    this.nextCallCount = 0
                    return@w _data[0]
                }
                val list80 = this.list80
                if (list80 != null && list80.length > 0 && this.list80ElementIndex < list80.length) {
                    this.is80 = true
                    return@w list80[this.list80ElementIndex++]
                } else if (this.is80 && list80 != null && this.list80ElementIndex >= list80.length) {
                    this.is80 = false
                }
                if (_list != null && _list.length > 0 && this.currentElementIndex < _list.length) {
                    this.nextCallCount++
                    this.onCompleteFn(this.currentElementIndex)
                    return@w _list[this.currentElementIndex++]
                }
                console.log("没找到题目")
                return@w null
        })
    }
}
open class countDown {
    private var onCompleteFn: (timeText: String) -> Unit
    private var onEndFn: () -> Unit
    private var endTime: Date?
    private var timer: Number = 0
    private var maxTime: Number = 0
    private var timeText: String = "00:00:00"
    open var isPause: Boolean = false
    constructor(){
        this.endTime = null
        this.onCompleteFn = fun(timeText: String){}
        this.onEndFn = fun(){}
    }
    open fun initDate(date: Date?) {
        if (date != null) {
            val parsedDate = date
            if (!isNaN(parsedDate.getTime())) {
                this.endTime = parsedDate
            } else {
                console.error("Invalid date format.")
            }
        }
    }
    open fun initString(date: String?) {
        if (date != null && date != "") {
            val parsedDate = Date(date)
            if (!isNaN(parsedDate.getTime())) {
                this.endTime = parsedDate
            } else {
                console.error("Invalid date format.")
            }
        }
    }
    open fun startCountdown(seconds: Number?) {
        if (seconds == null) {
            return
        }
        if (seconds == 0) {
            return
        }
        this.maxTime = seconds
        this.startFn()
    }
    open fun startFn() {
        if (this.maxTime == 0) {
            return
        }
        clearInterval(this.timer)
        val hours = Math.floor(this.maxTime / 3600)
        val minutes = Math.floor((this.maxTime % 3600) / 60)
        val secs = this.maxTime % 60
        this.timeText = "" + minutes.toString(10).padStart(2, "0") + ":" + secs.toString(10).padStart(2, "0")
        this.onCompleteFn(this.timeText)
        this.timer = setInterval(fun(){
            if (this.isPause) {
                return
            }
            this.maxTime--
            val hours = Math.floor(this.maxTime / 3600)
            val minutes = Math.floor((this.maxTime % 3600) / 60)
            val secs = this.maxTime % 60
            this.timeText = "" + minutes.toString(10).padStart(2, "0") + ":" + secs.toString(10).padStart(2, "0")
            this.onCompleteFn(this.timeText)
            if (this.maxTime <= 0) {
                clearInterval(this.timer)
                this.onEndFn()
                console.log("Countdown finished!")
            }
        }
        , 1000)
    }
    open fun start() {
        if (this.endTime == null) {
            console.error("End time is not set.")
            return
        }
        this.updateCountdown()
        this.timer = setInterval(fun(){
            if (this.isPause) {
                return
            }
            this.updateCountdown()
        }
        , 1000)
    }
    open fun updateCountdown() {
        val now = Date()
        val timeLeft = this.endTime!!.getTime() - now.getTime()
        if (timeLeft <= 0) {
            clearInterval(this.timer)
            this.onEndFn()
            this.timeText = "00:00:00"
        } else {
            val hours = Math.floor((timeLeft / 3600000) % 24)
            val minutes = Math.floor((timeLeft / 60000) % 60)
            val seconds = Math.floor((timeLeft / 1000) % 60)
            this.timeText = "" + hours.toString(10).padStart(2, "0") + ":" + minutes.toString(10).padStart(2, "0") + ":" + seconds.toString(10).padStart(2, "0")
        }
        this.onCompleteFn(this.timeText)
    }
    open fun onComplete(onCycleComplete: (timeText: String) -> Unit) {
        this.onCompleteFn = onCycleComplete
    }
    open fun onEnd(onEnd: () -> Unit) {
        this.onEndFn = onEnd
    }
    open fun clear() {
        clearInterval(this.timer)
    }
}
fun detectionHtml(text: String?): String {
    if (text == null) {
        return ""
    }
    val underlineRegex = UTSRegExp("<[^>]+>", "i")
    val matches = text.match(underlineRegex) ?: _uA()
    if (matches.length > 0) {
        return matches.join("")
    }
    return ""
}
