val getConfig = fun(key: String): UTSJSONObject {
    var _config = uni_getStorageSync("config")
    if (_config == "") {
        return UTSJSONObject()
    }
    var _key = configMap.getString(key)
    if (_key == null) {
        return UTSJSONObject()
    }
    var __config = _config as UTSArray<UTSJSONObject>
    val mapKey = __config.filter(fun(item: UTSJSONObject): Boolean {
        return item.getString("configKey") == _key
    }
    )
    if (mapKey.length == 0) {
        return UTSJSONObject()
    }
    var _item = mapKey[0].getString("configValue")
    if (_item != null) {
        var _json: UTSJSONObject = UTSJSONObject()
        if (UTSAndroid.`typeof`(_item) === "string") {
            val isPossibleJSON = UTSRegExp("^\\s*\\{[\\s\\S]*\\}\\s*\$", "").test(_item)
            if (isPossibleJSON) {
                try {
                    val parsed = JSON.parse(_item)
                    if (UTSAndroid.`typeof`(parsed) === "object" && parsed != null && !UTSArray.isArray(parsed)) {
                        _json = parsed as UTSJSONObject
                    } else {
                        _json = object : UTSJSONObject() {
                            var value = _item
                        }
                    }
                } catch (error: Throwable) {
                    _json = object : UTSJSONObject() {
                        var value = _item
                    }
                }
            } else {
                _json = object : UTSJSONObject() {
                    var value = _item
                }
            }
        } else {
            _json = object : UTSJSONObject() {
                var value = _item
            }
        }
        return _json
    }
    return UTSJSONObject()
}
