typealias ProblemType = String
fun splitBySpace(text: String, segments: UTSArray<timi>, id: Number) {
    var start: Number = -1
    var i: Number = 0
    while(i <= text.length){
        val isNbsp = i <= text.length - 6 && text.substring(i, i + 6) == "&nbsp;"
        val isSpaceOrEnd = i == text.length || UTSRegExp("\\s", "").test(text.charAt(i)) || isNbsp
        if (!isSpaceOrEnd && start == -1) {
            start = i
        } else if (isSpaceOrEnd && start != -1) {
            val word = text.substring(start, i)
            segments.push(timi(type = "text", content = word, id = id))
            start = -1
        }
        if (isNbsp) {
            i += 6
        } else {
            i++
        }
    }
}
fun processTextContent(text: String, segments: UTSArray<timi>, id: Number) {
    var buffer = ""
    var underscoreCount: Number = 0
    run {
        var i: Number = 0
        while(i < text.length){
            val char = text.charAt(i)
            if (char == "_" || char == "＿") {
                if (buffer.length > 0) {
                    splitBySpace(buffer, segments, id)
                    buffer = ""
                }
                underscoreCount++
            } else {
                if (underscoreCount > 0) {
                    if (underscoreCount >= 2) {
                        segments.push(timi(type = "input", content = "", id = id))
                    } else {
                        segments.push(timi(type = "text", content = "_".repeat(underscoreCount), id = id))
                    }
                    underscoreCount = 0
                }
                buffer += char
            }
            i++
        }
    }
    if (underscoreCount > 0) {
        if (underscoreCount >= 2) {
            segments.push(timi(type = "input", content = "", id = id))
        } else {
            segments.push(timi(type = "text", content = "_".repeat(underscoreCount), id = id))
        }
    } else if (buffer.length > 0) {
        splitBySpace(buffer, segments, id)
    }
}
fun findSubstringIgnoreCase(str: String, substr: String): Number {
    val lowerStr = str.toLowerCase()
    val lowerSubstr = substr.toLowerCase()
    return lowerStr.indexOf(lowerSubstr)
}
fun extractImgSrc(imgTag: String): String? {
    val srcIndex = findSubstringIgnoreCase(imgTag, "src=")
    if (srcIndex == -1) {
        return null
    }
    var valueStart = srcIndex + 4
    while(valueStart < imgTag.length){
        val char = imgTag.charAt(valueStart)
        if (char != " " && char != "\t" && char != "\n" && char != "\r") {
            break
        }
        valueStart++
    }
    if (valueStart >= imgTag.length) {
        return null
    }
    var quoteChar = ""
    val firstChar = imgTag.charAt(valueStart)
    if (firstChar == "\"" || firstChar == "'") {
        quoteChar = firstChar
        valueStart++
    }
    var valueEnd = valueStart
    if (quoteChar != "") {
        while(valueEnd < imgTag.length){
            if (imgTag.charAt(valueEnd) == quoteChar) {
                break
            }
            valueEnd++
        }
    } else {
        while(valueEnd < imgTag.length){
            val char = imgTag.charAt(valueEnd)
            if (char == " " || char == ">" || char == "\t" || char == "\n" || char == "\r") {
                break
            }
            valueEnd++
        }
    }
    if (valueEnd > valueStart) {
        return imgTag.substring(valueStart, valueEnd)
    }
    return null
}
fun processRichTextFn(html: String, id: Number): UTSArray<timi> {
    val segments: UTSArray<timi> = _uA()
    var currentText = ""
    var i: Number = 0
    while(i < html.length){
        if (html.charAt(i) == "<" && i + 4 < html.length && (html.charAt(i + 1) == "i" || html.charAt(i + 1) == "I") && (html.charAt(i + 2) == "m" || html.charAt(i + 2) == "M") && (html.charAt(i + 3) == "g" || html.charAt(i + 3) == "G")) {
            if (currentText.length > 0) {
                processTextContent(currentText, segments, id)
                currentText = ""
            }
            var imgEnd = i
            while(imgEnd < html.length){
                if (html.charAt(imgEnd) == ">") {
                    break
                }
                imgEnd++
            }
            val imgTag = html.substring(i, imgEnd + 1)
            i = imgEnd
            val src = extractImgSrc(imgTag)
            if (src != null) {
                segments.push(timi(type = "image", content = "", id = id, src = src))
            }
        } else if (html.charAt(i) == "<") {
            if (currentText.length > 0) {
                processTextContent(currentText, segments, id)
                currentText = ""
            }
            while(i < html.length && html.charAt(i) != ">"){
                i++
            }
        } else {
            currentText += html.charAt(i)
        }
        i++
    }
    if (currentText.length > 0) {
        processTextContent(currentText, segments, id)
    }
    return segments
}
fun processRichText(rich: examinationList): UTSArray<UTSArray<timi>>? {
    var richText = rich.questionContent!!
    val htmlTagRegex = UTSRegExp("<[^>]+>", "g")
    val textWithoutTags = richText.replace(UTSRegExp("<\\/?([^img][^>]*?|img\\s+[^>]*?)(?=\\/?)>", "gi"), "")
    val pTagRegex = UTSRegExp("<\\/?p[^>]*>", "gi")
    val normalizedText = richText.replace(pTagRegex, "\n")
    val lineBreakRegex = UTSRegExp("\r?\n")
    val lines = normalizedText.split(lineBreakRegex)
    val nonEmptyLines = lines.filter(fun(line): Boolean {
        return line.trim() !== ""
    }
    )
    val result: UTSArray<UTSArray<timi>> = _uA()
    val underlineRegex = UTSRegExp("_{2,}|＿{1,}", "g")
    var nowIndex: Number = 0
    nonEmptyLines.forEach(fun(line){
        if (rich.subProblemList != null) {
            result.push(processRichTextFn(line, rich.subProblemList!![nowIndex].id))
        } else {
            result.push(processRichTextFn(line, rich.id))
        }
    }
    )
    var isShowToast = false
    result.forEach(fun(item){
        item.forEach(fun(ele){
            if (rich.subProblemList != null) {
                if (ele.type == "input") {
                    if (nowIndex < rich.subProblemList!!.length) {
                        ele.id = rich.subProblemList!![nowIndex].id
                        nowIndex++
                    } else {
                        isShowToast = true
                    }
                }
            }
        }
        )
    }
    )
    if (isShowToast) {
        uni_showToast(ShowToastOptions(title = "数据错误，请联系管理员", icon = "none"))
    }
    return result
}
