        this.onBigCycleComplete = fun(num: Number){}
        this.onSmailCycleComplete = fun(num: Number){}
        this.currentGroupIndex = 0
        this.currentElementIndex = 0
        this.loopCount = 0
        this.changeFn = fun(list: UTSArray<UTSArray<UTSArray<answerItemType>>>){}
    }
