        this.onBigCycleComplete = onCycleComplete
    }
    open fun onSmailComplete(onCycleComplete: (num: Number) -> Unit) {
        this.onSmailCycleComplete = onCycleComplete
    }
    open fun markAsDone(problemId: Number): Unit {
        this.doneProblems.add(problemId)
    }
    open fun getTypeStatus(problemType: ProblemType): String {
        var total: Number = 0
        var done: Number = 0
        this.fen?.forEach(fun(group){
            group.forEach(fun(problem){
                if (problem.problemType === problemType) {
                    total++
                    if (this.doneProblems.has(problem.id)) {
                        done++
                    }
                }
            }
            )
        }
        )
        return JSON.stringify(_uO("done" to done, "total" to total))
    }
    open fun next(): examinationList? {
        var _fen = this.fen
        if (_fen == null) {
            return null
        }
        while(this.currentGroupIndex < _fen.length){
            val currentGroup = _fen[this.currentGroupIndex]
            if (currentGroup.length == 0) {
                this._moveToNextGroup()
                continue
            }
            if (this.currentElementIndex >= currentGroup.length) {
                this.loopCount++
                if (this.loopCount < 3) {
                    this.onSmailCycleComplete(this.loopCount)
                    this.currentElementIndex = 0
                } else {
                    this.onBigCycleComplete(this.currentGroupIndex)
                    this._moveToNextGroup()
                    continue
                }
            }
            return currentGroup[this.currentElementIndex++]
        }
        return null
    }
    open fun _moveToNextGroup() {
        this.currentGroupIndex++
        this.loopCount = 0
        this.currentElementIndex = 0
        this.onSmailCycleComplete(this.loopCount)
    }
