    open fun wordingTwo(_data: UTSArray<answerItemType>?, index: Number, optIndex: Number) {
        var _item = _data!![index]
        _item.isCheck = true
        _item.options.forEach(fun(item){
            item.isCheck = false
        }
        )
        _item.options[optIndex].isCheck = true
    }
    open fun wordingFn(_data: UTSArray<answerItemType>?, index: Number, problemType: String?) {
        var _item = _data!![index]
        if (problemType!! == "18") {
            var len = _data!!.filter(fun(item): Boolean {
                return item.isCheck
            }
            )
            if (len.length == 5 && !_item.isCheck == true) {
                uni_showToast(ShowToastOptions(title = "最多选择5个", icon = "none"))
                return
            }
        }
        var findIndex = _data?.findIndex(fun(item): Boolean {
            return item.content == ""
        }
        )
        if (findIndex!! < 0) {
            return
        }
        _item.isCheck = !_item.isCheck
        if (_item.isCheck) {
            _data!![findIndex!!].content = if (_item.isCheck) {
                _item.title
            } else {
                ""
            }
        } else {
            _data?.forEach(fun(item){
                if (item.content == _item.title) {
                    item.content = ""
                }
            }
            )
        }
    }
    open fun change(onList: (list: UTSArray<UTSArray<UTSArray<answerItemType>>>) -> Unit) {
        this.changeFn = onList
    }
}
