typealias UseTransitionReturnType = Ref<Number>
fun useTransition(source: Any, options: UseTransitionOptions): UseTransitionReturnType {
    val outputRef: Ref<Number> = ref(0)
    val immediate = options.immediate ?: false
    val duration = options.duration ?: 300
    val context = options.context
    var tl: Timeline? = null
    var timer: Number = -1
    val watchFunc = fun(v: Number){
        if (tl == null) {
            tl = Timeline()
        }
        tl!!.start()
        tl!!.add(Animation(outputRef.value, v, duration, 0, ease, fun(nowValue){
            outputRef.value = nowValue
            clearTimeout(timer)
            if (outputRef.value == v) {
                timer = setTimeout(fun(){
                    tl?.pause()
                    tl = null
                }
                , duration)
            }
        }
        ), null)
    }
    if (context != null && UTSAndroid.`typeof`(source) == "string") {
        context.`$watch`(source as String, watchFunc, WatchOptions(immediate = immediate))
    } else if (UTSAndroid.`typeof`(source) == "function") {
        watch(source, watchFunc, WatchOptions(immediate = immediate))
    } else if (isRef(source) && source is Ref<*>) {
        watch(source as Ref<Number>, watchFunc, WatchOptions(immediate = immediate))
    }
    return outputRef
}
val parseColor = fun(hexStr: String): UTSArray<Number>? {
    if (!UTSRegExp("^#.{3,6}\$", "").test(hexStr)) {
        console.error("lime-circle: 渐变仅支持hex值")
        return _uA<Number>(0, 0, 0)
    }
    return if (hexStr.length == 4) {
        hexStr.substring(1).split("").map(fun(s: String): Number {
            return 0x11 * parseInt(s, 16)
        })
    } else {
        _uA(
            hexStr.substring(1, 3),
            hexStr.substring(3, 5),
            hexStr.substring(5, 7)
        ).map(fun(s: String): Number {
            return parseInt(s, 16)
        }
        )
    }
}
val pad = fun(s: String): String {
    return s.padStart(2, "0")
}
val gradientColors = fun(start: String, end: String, steps: Number, gamma: Number): UTSArray<String> {
    var i: Number
    var j: Number
    var ms: Number
    var me: Number
    var output: UTSArray<String> = _uA()
    var so = _uA(
        "",
        "",
        ""
    )
    val normalize = fun(channel: Number): Number {
        return Math.pow(channel / 255, gamma)
    }
    val startColor = parseColor(start)!!.map(normalize)
    val endColor = parseColor(end)!!.map(normalize)
    if (startColor.length == 0 && endColor.length == 0) {
        return _uA()
    }
    run {
        i = 0
        while(i < steps){
            ms = i / (steps - 1)
            me = 1 - ms
            run {
                j = 0
                while(j < 3){
                    so[j] = pad(Math.round(Math.pow(startColor[j] * me + endColor[j] * ms, (1 as Number) / gamma) * 255).toInt().toString(16))
                    j++
                }
            }
            output.push("#" + so.join(""))
            i++
        }
    }
    return output
}
