fun getCurrentDateString(): String {
    val now = Date()
    val year = now.getFullYear()
    val month = (now.getMonth() + 1).toString(10).padStart(2, "0")
    val day = now.getDate().toString(10).padStart(2, "0")
    return "" + year + month + day
}
typealias OSSUploadCallback = (error: String?, data: String?) -> Unit
fun uploadFileToOSS(filePath: String, callback: OSSUploadCallback): Unit {
    uni_request<Result<ossConfigResult>>(RequestOptions(url = getUrl("/api/general/biz/ramGenerateSignature"), header = getHeader(), method = "GET", success = fun(res){
        val responseData = res.data
        if (responseData == null) {
            return
        }
        if (responseData.code as Number != 200) {
            uni_showToast(ShowToastOptions(title = responseData.msg, icon = "none"))
            return
        }
        if (responseData.data == null) {
            return
        }
        var extractedFileName = ""
        val mscIndex = filePath.indexOf("/msc/")
        if (mscIndex !== -1) {
            extractedFileName = filePath.substring(mscIndex + 5)
        } else {
            extractedFileName = if (filePath.split("/").pop() == "") {
                ""
            } else {
                "unknown"
            }
        }
        val userId = userState.value?.userId ?: 0
        val currentDate = getCurrentDateString()
        val finalFileName = "default/user/speak/" + userId + "/" + currentDate + "/" + extractedFileName
        val config: UTSJSONObject = object : UTSJSONObject() {
            var key = finalFileName
            var policy = responseData.data!!.policy
            var xOssSignatureVersion = responseData.data!!.x_oss_signature_version
            var xOssCredential = responseData.data!!.x_oss_credential
            var xOssDate = responseData.data!!.x_oss_date
            var xOssSignature = responseData.data!!.signature
            var xOssSecurityToken = responseData.data!!.security_token
            var bucketUrl = responseData.data!!.host
        }
        val formData: UTSJSONObject = object : UTSJSONObject() {
            var key = config["key"]
            var policy = config["policy"]
            var `x-oss-signature-version` = config["xOssSignatureVersion"]
            var `x-oss-credential` = config["xOssCredential"]
            var `x-oss-date` = config["xOssDate"]
            var `x-oss-signature` = config["xOssSignature"]
            var `x-oss-security-token` = config["xOssSecurityToken"]
            var success_action_status = "200"
        }
        uni_uploadFile(UploadFileOptions(url = config["bucketUrl"] as String ?: "", filePath = filePath, name = "file", formData = formData, success = fun(res){
            callback(null, (config["bucketUrl"] as String) + "/" + finalFileName as String)
        }
        , fail = fun(err){
            console.error("OSS上传失败:", err)
            uni_showToast(ShowToastOptions(title = "上传失败，请重试!", icon = "none"))
            callback("上传错误", null)
        }
        ))
    }
    , fail = fun(err: Any){
        console.error("请求OSS签名接口失败:", err)
        uni_showToast(ShowToastOptions(title = "获取上传参数失败，请重试!", icon = "none"))
    }
    ))
}
