open class Friction {
    open var mass: Number
    open var frictionForce: Number
    open var startTime: Number
    open var velocity: Speed
    open var acceleration: Speed
    open var startPosition: Speed
    open var endPosition: Speed? = null
    open var lastTimeElapsed: Number? = null
    open var totalTimeToStop: Number = 0
    constructor(mass: Number, frictionForce: Number){
        this.mass = mass
        this.frictionForce = 1000 * frictionForce
        this.startTime = 0
        this.velocity = Speed(x = 0, y = 0)
        this.acceleration = Speed(x = 0, y = 0)
        this.startPosition = Speed(x = 0, y = 0)
        this.endPosition = null
        this.lastTimeElapsed = null
    }
    open fun setVelocity(x: Number, y: Number) {
        val speed = Math.sqrt(x * x + y * y)
        this.velocity = Speed(x = x, y = y)
        this.acceleration = Speed(x = -this.frictionForce * x / speed, y = -this.frictionForce * y / speed)
        this.totalTimeToStop = Math.abs(x / this.acceleration.x)
        if (UTSNumber.isNaN(this.totalTimeToStop)) {
            this.totalTimeToStop = Math.abs(y / this.acceleration.y)
        }
        if (UTSNumber.isNaN(this.totalTimeToStop)) {
            this.totalTimeToStop = 0
        }
        this.startTime = Date.now()
        this.lastTimeElapsed = null
    }
    open fun setStartPosition(x: Number, y: Number) {
        this.startPosition = Speed(x = x, y = y)
    }
    open fun setEndPosition(x: Number, y: Number) {
        this.endPosition = Speed(x = x, y = y)
    }
    open fun positionAtTime(reassignedT: Number?): Speed {
        var t = reassignedT
        if (t == null) {
            t = (Date.now() - this.startTime) / 1000
        }
        if (t > this.totalTimeToStop) {
            t = this.totalTimeToStop
            this.lastTimeElapsed = t
        }
        var x = this.velocity.x * t + 0.5 * this.acceleration.x * t * t + this.startPosition.x
        var y = this.velocity.y * t + 0.5 * this.acceleration.y * t * t + this.startPosition.y
        if ((this.acceleration.x > 0 && x < this.endPosition!!.x) || (this.acceleration.x < 0 && x > this.endPosition!!.x)) {
            x = this.endPosition!!.x
        }
        if ((this.acceleration.y > 0 && y < this.endPosition!!.y) || (this.acceleration.y < 0 && y > this.endPosition!!.y)) {
            y = this.endPosition!!.y
        }
        return Speed(x = x, y = y)
    }
    open fun velocityAtTime(reassignedT: Number?): UTSJSONObject {
        var t = reassignedT
        if (t == null) {
            t = (Date.now() - this.startTime) / 1000
        }
        if (t > this.totalTimeToStop) {
            t = this.totalTimeToStop
        }
        return _uO("dx" to (this.velocity.x + this.acceleration.x * t), "dy" to (this.velocity.y + this.acceleration.y * t))
    }
    open fun displacement(): Speed {
        var tx = (-1.5 * Math.pow(this.velocity.x, 2) / this.acceleration.x)
        if (UTSNumber.isNaN(tx)) {
            tx = 0
        }
        var ty = (-1.5 * Math.pow(this.velocity.y, 2) / this.acceleration.y)
        if (UTSNumber.isNaN(ty)) {
            ty = 0
        }
        return Speed(x = tx, y = ty)
    }
    open fun timeToStop(): Number {
        return -this.velocity.x / this.acceleration.x
    }
    open fun isDone(): Boolean {
        val currentPosition = this.positionAtTime(null)
        return (currentPosition.x === this.endPosition!!.x && currentPosition.y === this.endPosition!!.y || this.lastTimeElapsed === this.totalTimeToStop)
    }
    open fun reconfigure(mass: Number, frictionForce: Number) {
        this.mass = mass
        this.frictionForce = 1000 * frictionForce
    }
}
